(function($) {
	    
	$.fn.quickPager = function(options) {
	
		var defaults = {
			pageSize: 10,
			currentPage: 1,
			holder: null,
			pagerLocation: "after"
		};
		
		var options = $.extend(defaults, options);
		
		
		return this.each(function() {
	
						
			var selector = $(this);	
			var pageCounter = 1;
			
			selector.wrap("<div class='simplePagerContainer'></div>");
			
			selector.children().each(function(i){ 
					
				if(i < pageCounter*options.pageSize && i >= (pageCounter-1)*options.pageSize) {
					$(this).addClass("simplePagerPage"+pageCounter);
				}
				else {
					$(this).addClass("simplePagerPage"+(pageCounter+1));
					$(this).addClass("noRulerBefore");
					pageCounter ++;
				}	
				
			});
			
			// show/hide the appropriate regions 
			selector.children().hide();
			selector.children(".simplePagerPage"+options.currentPage).show();
			
			var pageNav1 = "<div class='result-nav'><ul class='filter'><li><div class='all'>"+$('.results-labels .allresult-label').html()+"</a></li><li><div class='pdf'>"+$('.results-labels .pdfresult-label').html()+"</a></li><li><div class='product'>"+$('.results-labels .productresult-label').html()+"</a></li></ul></div>";	
			
			if(pageCounter <= 1) {
				switch(options.pagerLocation)
				{
				case "before":
					//selector.before(pageNav1);
					return;
				break;
				case "both":
					//selector.before(pageNav1);
					return;
				break;
				case "both-search":
					selector.before(pageNav1);
					return;
				break;
				default:
					return;
				}
			}
			
			//Build pager navigation
			if(!options.holder) {
				prepreviouxindex = options.currentPage-2;
				previouxindex = options.currentPage-1;
				nextindex = parseInt(options.currentPage)+1;
				postnextindex = parseInt(options.currentPage)+2;

				var pageNav1 = "<div class='result-nav'><ul class='filter'><li><div class='all'>"+$('.results-labels .allresult-label').html()+"</a></li><li><div class='pdf'>"+$('.results-labels .pdfresult-label').html()+"</a></li><li><div class='product'>"+$('.results-labels .productresult-label').html()+"</a></li></ul>";	
				var pageNav2 = "<div class='result-nav'>";	
				pageNav = "<ul class='simplePagerNav paging'>";	
				pageNav +=  "<li class='disable previous'><a rel='"+options.currentPage+"' href='#'>prochaine</a></li>";
				if (pageCounter<5){
					for (i=1;i<=pageCounter;i++){
						if (i==options.currentPage) {
							pageNav += "<li class='active simplePageNav"+i+"'><a rel='"+i+"' href='#'>"+i+"</a></li>";	
						}
						else {
							pageNav += "<li class='simplePageNav"+i+"'><a rel='"+i+"' href='#'>"+i+"</a></li>";
						}
					}
				} else {
					pageNav += "<li class='simplePageNavfisrt'><a rel='1' href='#'>1</a></li>";	
					pageNav += "<li class='simplePageNavetcbefore'>&nbsp;...</li>";

					pageNav += "<li class='simplePageNavprepre'><a rel='"+prepreviouxindex+"' href='#'>"+prepreviouxindex+"</a></li>";	

					pageNav += "<li class='simplePageNavpre'><a rel='"+previouxindex+"' href='#'>"+previouxindex+"</a></li>";	
					pageNav += "<li class='active simplePageNavcurent'><a rel='"+options.currentPage+"' href='#'>"+options.currentPage+"</a></li>";	
					pageNav += "<li class='simplePageNavpost'><a rel='"+nextindex+"' href='#'>"+nextindex+"</a></li>";	

					pageNav += "<li class='simplePageNavpostpost'><a rel='"+postnextindex+"' href='#'>"+postnextindex+"</a></li>";	

					pageNav += "<li class='simplePageNavetcafter'>...&nbsp;</li>";
					pageNav += "<li class='simplePageNavlast'><a rel='"+pageCounter+"' href='#'>"+pageCounter+"</a></li>";	
				}
				pageNav += "<li class='last next'><a rel='"+nextindex+"' href='#'>prcdent</a></li>";
				pageNav += "</ul></div>";
				pageNav1 += pageNav;
				pageNav2 += pageNav;
			} else {
				pageNav = "<ul class='simplePagerNav paging'>";	
				if (pageCounter<5){
					for (i=1;i<=pageCounter;i++){
						if (i==options.currentPage) {
							pageNav += "<li class='active simplePageNav"+i+"'><a rel='"+i+"' href='#'>"+i+"</a></li>";	
						}
						else {
							pageNav += "<li class='simplePageNav"+i+"'><a rel='"+i+"' href='#'>"+i+"</a></li>";
						}
					}
				}
				pageNav += "</ul>";
			}
			
			if(!options.holder) {
				switch(options.pagerLocation)
				{
				case "before":
					selector.before(pageNav1);
				break;
				case "both":
					selector.before(pageNav2);
					selector.after(pageNav2);
				break;
				case "both-search":
					selector.before(pageNav1);
					selector.after(pageNav2);
				break;
				default:
					selector.after(pageNav2);
				}
			}
			else {
				$(options.holder).append(pageNav);
			}
			
			//hide pager elements that are not use on the first pass
			if(!options.holder) {
				selector.parent().find("li.simplePageNavfisrt").hide();
				selector.parent().find("li.simplePageNavetcbefore").hide();
				selector.parent().find("li.simplePageNavprepre").hide();
				selector.parent().find("li.simplePageNavpre").hide();
			}
			/*
			simplePageNavfisrt
			simplePageNavetcbefore
			simplePageNavprepre
			simplePageNavpre
			simplePageNavcurent
			simplePageNavpost
			simplePageNavpostpost
			simplePageNavetcafter
			simplePageNavlast
			*/
			
			//pager navigation behaviour
			selector.parent().find(".simplePagerNav a").click(function() {
					
				//grab the REL attribute 
				var clickedLink = $(this).attr("rel");
				options.currentPage = clickedLink;
				prepreviouxindex = clickedLink-2;
				previouxindex = clickedLink-1;
				nextindex = parseInt(clickedLink)+1;
				postnextindex = parseInt(clickedLink)+2;

				if(!options.holder) {
					//Previous
					if (parseInt(options.currentPage)!=1) {
						$(this).parent().parent().parent().parent().find(".paging li.previous").removeClass("disable");
						$(this).parent().parent().parent().parent().find(".paging li.previous a").attr("rel",previouxindex);
					} else {
						$(this).parent().parent().parent().parent().find(".paging li.previous").addClass("disable");
						$(this).parent().parent().parent().parent().find(".paging li.previous a").attr("rel",options.currentPage);
					}
					
					if (parseInt(pageCounter)<5){
						//remove current current (!) page
						$(this).parent().parent().parent().parent().find(".paging li.active").removeClass("active");
						//Add current page highlighting
						$(this).parent().parent().parent().parent().find(".paging a[rel='"+clickedLink+"']:first-child").parent().addClass("active");
						$(this).parent().parent().parent().parent().find(".paging li.last").removeClass("active");
					} else {
						// Modification of the link value
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavprepre a").attr("rel",prepreviouxindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavprepre a").html(prepreviouxindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpre a").attr("rel",previouxindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpre a").html(previouxindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavcurent a").attr("rel",options.currentPage);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavcurent a").html(options.currentPage);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpost a").attr("rel",nextindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpost a").html(nextindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpostpost a").attr("rel",postnextindex);
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpostpost a").html(postnextindex);

						// Show all links
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavfisrt").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavetcbefore").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavprepre").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpre").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpost").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpostpost").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavetcafter").show();
						$(this).parent().parent().parent().parent().find(".paging li.simplePageNavlast").show();
						
						// Hide links in fonction of the current page
						if (options.currentPage<=2) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavfisrt").hide();
						}
						if (options.currentPage<=3) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavetcbefore").hide();
						}
						
						if (options.currentPage != pageCounter) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavprepre").hide();
						}

						if (options.currentPage==1) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpre").hide();
						}
						if (options.currentPage== pageCounter) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpost").hide();
						}

						if (parseInt(options.currentPage) != 1) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavpostpost").hide();
						}

						if (parseInt(options.currentPage)>= pageCounter-2) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavetcafter").hide();
						}
						if (parseInt(options.currentPage)>= pageCounter-1) {
							$(this).parent().parent().parent().parent().find(".paging li.simplePageNavlast").hide();
						}
					}
					
					//Next
					if (parseInt(options.currentPage)!= pageCounter) {
						$(this).parent().parent().parent().parent().find(".paging li.next").removeClass("disable");
						$(this).parent().parent().parent().parent().find(".paging li.next a").attr("rel",nextindex);
					} else {
						$(this).parent().parent().parent().parent().find(".paging li.next").addClass("disable");
						$(this).parent().parent().parent().parent().find(".paging li.next a").attr("rel",options.currentPage);
					}
				} else {
					$(this).parent("li").parent("ul").parent(options.holder).find("li.active").removeClass("active");
					$(this).parent("li").parent("ul").parent(options.holder).find("a[rel='"+clickedLink+"']").parent("li").addClass("active");
				}
								
				//hide and show relevant links
				selector.children().hide();			
				selector.find(".simplePagerPage"+clickedLink).show();
				
				return false;
			});
		});
	}
	

})(jQuery);


function openPic(url,winName,winParams){var theWindow=window.open(url,winName,winParams);if(theWindow)theWindow.focus()};
